import { Routes, Route} from 'react-router-dom';
import './App.css';

import Header from './components/Header';
import Main from './routes/Main';

function App() {
  return (
    <div className='wrapper'>
      <div className="App">
        <Header name="Роман"/>
        <Routes>
          <Route path="/" element={<Main/>}/>
          <Route path='/create' element={<Create/>}/>
        </Routes>
      </div>
    </div>
  );
}

export default App;
